const loginContainerStyle = {
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  margin: '20px',
};

const inputStyle = {
  margin: '5px',
  padding: '8px',
};

const buttonStyle = {
  marginTop: '10px',
  padding: '8px',
  cursor: 'pointer',
};

export { loginContainerStyle, inputStyle, buttonStyle };
